import React from 'react'
import JsonData from '../teams.json'

 function JsonDataDisplay(){

    const columns = [
        {
            name: 'League ID',
            selector: row => row.LeagueID,
        },
        {
            name: 'Name',
            selector: row => row.Name,
        },
        {
            name: 'Oddset Name',
            selector: row => row.OddsetName,
        },

        {
            name: 'TV4 Name',
            selector: row => row.TV4Name,
        },

    ];

    return(
        <div>
            <table class="table table-striped">
                <thead>
                    <tr>
                    <th>LeagueID</th>
                    <th>Name</th>
                    <th>Odds Name</th>
                    <th>TV4Name</th>
                    </tr>
                </thead>
                <tbody>


                    {DisplayData}

                </tbody>
            </table>

        </div>
    )
 }

 export default JsonDataDisplay;
